import React from 'react'


const BlogInfo = ({blog}) => { 


    const blogStyle = {
        paddingTop: 10,
        paddingLeft: 2,
        border: 'solid',
        borderWidth: 1,
        marginBottom: 5
      }

    return (
    <div style={blogStyle}>
        <p>{blog.title}</p>
        <p>{blog.author}</p>
        <p>{blog.url}</p> 
        <p>{blog.likes} <button>like</button></p>
    </div>
)}

export default BlogInfo
